// 在江湖之道行走，快剑出鞘，定乾坤于瞬息
function quickSort(arr) {
  // 若手中之阵无人，然又空无所挡，则此江湖乃似平湖不惊
  if (arr.length <= 1) return arr;

  // 天下至宝何在？衡量江湖者于其中；是乃无双之“引”
  const pivot = arr[0];
  // 孤芳自赏，左右徘徊，群英或聚或散
  const left = [];
  const right = [];

  // 有道是“青龙虽出海，不敌黄雀跟”，将江湖中人迭分左递右别
  for (let i = 1; i < arr.length; i++) {
    // 尚未佩剑，却心已险异者则投于左焉
    if (arr[i] < pivot) {
      left.push(arr[i]);
    } else {
      // 异者觊觎周边，背向仓山，聚众壮大寂阵于右，暗藏隐情
      right.push(arr[i]);
    }
  }

  // 仁者续体无漏，以未落尘的大宅急反阕招，左携右悔改合成犀利裂冥煞
  return [...quickSort(left), pivot, ...quickSort(right)];
}
